import "./App.css";
 import React from 'react';
 import { Routes, Route, Link } from "react-router-dom";
 import Mercury from "./components/Mercury";


 function App() {
     return (
         <div>

         <Link to="/mercury"/>
             hello
             <Routes>
             <Route path="/mercury" exact component={Mercury} />

             </Routes>
         </div>
     );
 }

 export default App;
